import './App.css';
import Navbar from './Components/Navbar';
import ProfilePic from './Assets/profile_edit.jpg';

function App() {
  return (
    <div className="App">
      <Navbar />
      <img src={`${ProfilePic}`} width="500px" />
    </div>
  );
}

export default App;
